window.bookSummaryJSON = "<p>From USA Today Bestselling Author Brynne Asher...</p> <p>One day, I was chugging along at life as a wedding planner. The next, I’m a confidential informant and fake engaged to the grumpiest DEA agent on earth.</p> <p>Hit the brakes. Let’s back up.</p> <p>You know those sappy made-for-TV movies where the leading lady gets the unsuspecting knock on the door and is the beneficiary of a massive inheritance?</p> <p>That’s me. I’m that heroine.</p> <p>My name is Goldie Carter, and inheriting The Pink—one of the most historic and grandest estates in Miami—would be a dream come true for any gal, but especially me.</p> <p>I’m a true romantic. I believe in soul-wrenching love so deep, to have it ripped away would physically hurt.</p> <p>But I’m still waiting for my prince charming.</p> <p>And life isn’t so golden at the moment.</p> <p>Money, greed, and cartels have a way of forcing love to the backburner when a surprise half-brother rears his ugly head.</p> <p>Enter Kingston Jennings, Special Agent for the DEA—and quite possibly the crankiest man I’ve ever met.</p> <p>That’s how I got to where I am right now.</p> <p>Fake engaged.</p> <p>And falling in love.</p> <p>Little did I know, I don’t need a prince charming.</p> <p>I need a King.</p>"; 
